import React from 'react';

const Card = () => {
  return (
    <div style={styles.container}>
    
          <p> </p>
        
      </div>
   
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'center',
  },
  card: {
    width: 500,
    height: 250,
    backgroundColor: 'white',
    borderRadius: 10,
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    padding: 20,
    margin: 20,
  },
  text: {
    fontSize: 18,
  },
};

export default Card;
